script: |
  super -f text -I q10199.spq | sort > q10199.out

inputs:
  - name: q10199.spq
    data: |
      SELECT DISTINCT - + col2, + col1 FROM tab2 (FORMAT parquet) WHERE - col1 + + - col0 NOT BETWEEN NULL AND - - col0 * - - col0 - 24 * col2;
  - name: tab2

outputs:
  - name: q10199.out
    data: |
